import React from "react";
import data from "./babyNamesData.json";
import "./App.css";

function App() {
  return (
    <div className="App">
      {data.map((el) => {
        if (el.sex === "f") return "  " + el.name + "   ";
      })}
    </div>
  );
}

export default App;
